"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/ZLxg5sd85ZSM0pTwY5_VNQ/l.jpg",
"rating":"3.5",
"reviewcomment":"I sometimes walk along this mall, when it rains or is cold.  This is because it is connected to Shinsaibashi station and is located on underground.  The passage is so wide that I can see the goods leisurely.  If you walk on Nagahori street, you can find entrance to the underground everywhere.  <br>I think customers in various ages enjoy shopping here.  If you don&#39;t want to spend money too much on clothes, shoes, or others, you may search for them here.  You may buy them here more reasonably than at department stores.  <br>Among them,  the boutique, GALLARDA　GALANTE is my favorite.  This shop stands only here and Nanba Parks in Osaka.   Its dealing products are stylish and decent.  I bought a summer jersey dress here almost five years ago, but I have still wore it.  Every friend of mine praises the dress.  It is especially useful for a travel, because it is hard to make wrinkles.  <br>While you walk along the street, watching the shop of both sides, you will arrive at Yotsubashi station all too soon.  <br>In the fashion town there is an art gallery where various exhibitions such as paintings, printings, photographs, calligraphies are displayed.",
