"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/Hd-iQMrpmn7DDfsBcLk9Vg/l.jpg",
"rating":"4.0",
"reviewcomment":"Historical buildings spatter in Kitahama and Nakanoshima area.  I am attracted by such buildings and really hope that they will exist from now on.  This retro and classical  brick with blue roof building is also outstanding on the large street.  I thought it natural that this building is designated as a registered tangible cultural asset. <br>This café has two floors, on the first floor you can buy home-made country-style English cakes and general goods and on the second floor you can have  light meals or sweets, tea in the cafe.  Among them scorns are very famous!  I ate them after dipping whipped cream or jam, which tasted very good!  Additionally they are served in Wedgewood teacups and plates.   I liked grace and decent atmosphere of this café.  I was interested in three-layered plates consisting of sandwiches on the first plate, scorns with whipped cream and jam on the second plate, baked pound cakes on the third plate.  I bought similar-typed two layered plates in another shop.  <br>Surrounded by English amenities, you feel as if you were in England.",
