"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/svEtmOaauSdHdtVgmRR1gg/l.jpg",
"rating":"4.5",
"reviewcomment":"I was at a loss whether I review OPA or The Cosmos situated on the basement of the OPA, then I decided to review OPA.  This is because I imagine that few persons know what The Cosmos deals in.  <br>I seldom come to this complex, OPA as it seemed to be targeted for the youth.  <br>This eleven-storied complex houses restaurants, beauty salons, a reform shop and fashion shops.  It also has an annex.<br>Anyway, The Cosmos provides cosmetics and fragrances of various manufacturers.  I use foundation made by L company.  This shop also provides the goods of L.  I don&#39;t know any other shops providing the goods of L around Shinsaibashi area.  Daimaru Dept. in Umeda houses this tenant, which is often crowded with customers and I have to wait for a little.  But this is not so crowded and a hidden shop for L&#39;s fans.  The staff listens to us politely and elaborately.  Service is good!  I received a skin check for free here.  <br>What is better is that I am given a point card if I purchase something.  I am given 1 point when I buy something every 1,000 yen. I can trade with a product for 1,000 yen if I save 20 points. Of course it is free to become a member. Don&#39;t miss it!",
