"rating":"3.5",
"reviewcomment":"I was attracted by the catch copy, &#34;Promenade of 1,000m&#34;.  It is very long commercial building.  Senba has a long-standing history.  It begins in the period when Toyotomi Hideyoshi built the Osaka castle.  Around here inns, Japanese-style restaurants, shops such as clothes, hardware marchants gathered and flourished.  It had been popular during the Showa period.  However vacant spaces where shops had been on business are outstanding now.  The shops still now continue their business has old good time atmosphere.  They have been supported by familiar customers for a long time.  <br>There are long lines of shops side by side.  I found the restroom for men and women are located in separate row.  Usually both restrooms stand side by side.  Women feel comfortable that male restroom is distant from their restroom.  <br>I discovered cute paper works of 4 or 5- year-old children, which made me happy.  <br>I hope this commercial center will remain for next future.  I would like old good things to last forever.",
