"rating":"4.0",
"reviewcomment":"I love this chocolate shop.  It originally was located on the second floor of an old building in Shinsaiwashi moll.  I had been there for several times.  But it was moved to the place.  This was my first time that I came here after it was moved.  The old atmosphere was much more tasteful than before.  It also provides light meals.  <br>I was at a loss whether I should do a lunch here, and I didn&#39;t have lunch here.  It offered bread and light meals.  I wanted to have rice.  So I bought Brugse Klinkers.  Maccha, milk, espresso, and white, assortments of it are also provided, but I chose only milk.  It tasted soft and mild sweet.  When I threw it into the mouth, it smelted like snow.  I advise you to choose this one.  It is recommendable for gift.  Others, there are a variety of gem-like chocolates in the shop.  If you are cacao addictive, you had better try it once.",
