"rating":"4.0",
"reviewcomment":"We stopped by for a meal after a particularly exhausting day wandering Kyoto. The sign out front advertised green tea tiramisu pancakes, and we were sold! (<a href='http://www.yelp.com/biz_photos/%EF%BD%85%EF%BD%8C%EF%BD%8B-%E5%A4%A7%E9%98%AA%E5%B8%82-%E4%B8%AD%E5%A4%AE%E5%8C%BA?select=Z8lGiJmC1pkGIPaORB_OWQ#Z8lGiJmC1pkGIPaORB_OWQ'>yelp.com/biz_photos/ｅｌｋ-…</a>)<br><br>We walked in, essentially pointing to what we wanted, and watched the lady chefs begin to prepare the food. I should note (as it may be important to some): those young ladies were straight out of a fashion magazine, I kid you not. Possibly the most beautifully dressed, coiffed, and best looking chefs I&#39;ve ever seen in a kitchen. Anyway, we grabbed our number and found seats upstairs, which had a view of the shopping area.<br><br>+Kyo-to style pancake with black soybeans and soy flour: <a href='http://www.yelp.com/biz_photos/%EF%BD%85%EF%BD%8C%EF%BD%8B-%E5%A4%A7%E9%98%AA%E5%B8%82-%E4%B8%AD%E5%A4%AE%E5%8C%BA?select=Z8lGiJmC1pkGIPaORB_OWQ#y8nMFmQ8x8RFA4knvEPVvw'>yelp.com/biz_photos/ｅｌｋ-…</a><br>+Matcha tiramisu pancake: <a href='http://www.yelp.com/biz_photos/%EF%BD%85%EF%BD%8C%EF%BD%8B-%E5%A4%A7%E9%98%AA%E5%B8%82-%E4%B8%AD%E5%A4%AE%E5%8C%BA?select=Z8lGiJmC1pkGIPaORB_OWQ#zDNZhY_OTBE3LuEgYL_A7A'>yelp.com/biz_photos/ｅｌｋ-…</a><br><br>Both delicious, both incredibly satiating. <br><br>Since we sat on the second floor, we had a view onto one of the shopping side streets. We, being the only two non-Asian folk, loved waving back to the kids from up high as we stuffed our faces with fluffy pancakes. &#34;Silly Americans,&#34; they&#39;d think. ...And they&#39;d be right.",
