"rating":"4.5",
"reviewcomment":"This place is certainly an experience!  Who doesn&#39;t love a good deep fried meal?  I&#39;m not talking tempura, I&#39;m talking seriously deep fried, corn dog style. <br><br>For the Americans reading this, no worries trying this place. The staff was extremely friendly and they had an English menu. A few of the waitresses even took it as an opportunity to practice their English, which was very humorous to them and to us. <br><br>Anyway, the food!  Interesting concept. Choose your meat or vegetable. A few minutes later the deep fried goodies arrive on sticks on a small metal tray. From there dip the entire stick of food into this vat of sauce on the counter (no double dipping! They have special instructions on the table). Most of the sticks are 130 yen or so. Grab a beer and go to town. Don&#39;t be shy on a second or third order. <br><br>The traditional beef was great, but the pork and asparagus were our favorites.",
