"rating":"4.0",
"reviewcomment":"I would like to take a picture of a female mascot doll with a large round funny face in kimono which stands in front of the shop.  It is called &#34;Ujiko-chan&#34; and seems to be a tea leaves-picking girl.  I was impressed with this characteristic doll.  But I can&#39;t post the photograph on the site for fear of copyright infringement.<br>This is a shop as well as a café.  I entered the café for several times to eat green tea parfait or Japanese tea sweets.  I considered the cost and bought roasted tea soft cream recently at store. But I could not bring in the ice-cream cone to a back cafe. A middle-aged woman like me felt uneasy to eat an ice-cream cone at Shinsaibashi mall with much pedestrian traffic.   It tasted good.  I like roasted tea rather than green tea.  At home I usually drink roasted tea while having lunch or dinner.  <br>If you buy a gift of tea selection for foreign friends, either &#34;Okame&#34; (plain-looking woman) or &#34;Hyottoko&#34; (man with a clownish mask) is recommendable.  Okame is deep-steam green tea and Hyottoko is roasted tea on far infrared rays for a long time.  The respective paintings of the packages are very cute.  Probably your foreign friends are glad to see the goods.  It costs a little high.  But the goods of high-quality are generally expensive.  I&#39;m going to buy Okame or Hyottoko for my foreign friend.",
