"reviewcomment":"Ikayaki:  &#34;Ika&#34; Squid &amp; &#34;Yaki&#34; grilled<br><br>I have some fond memories of going to the basement of Hanshin Department store with my parents where they would treat me to this Ikayaki.  As a child, I loved it.  I admit that I really do not remember the taste of it as a child, but I vividly remember the dark basement floor with low ceiling with LOTS of people pushing and shoving.  It makes me sentimental thinking about it.<br><br>Decades has past and I now have mixed feelings about the current state.  Now, it is so famous that there is always a long line out the door.  Every tourist (not just foreigners, but people from Tokyo visiting Osaka) wants to try one.  What I really did not like was their no photography rule.  What is with that?  Anti-Yelp?  If Tokyo tourists find this place to be an exciting tourist destination, let them take photos!  I felt that this reflected their &#34;we are so famous&#34; attitude.  <br><br>WHAT THE HELL  IS IT:  Do you know Okonomiyaki?  It is pretty much that, but without cabbage.  Main ingredient is squid and not a blend of things like Okonomiyaki.  They fold it in half, so it is not circular like Okonomiyaki, but shaped more like an omelette.    <br><br>IS IT WORTH THE WAIT:  Not so much if your primary goal is to enjoy tasty food.  Regular Okonomiyaki is much better in my mind.  This is more of a snack food which people enjoyed in the past because it was so cheap.  It is worth the wait, if you just to say you&#39;ve had one of the most famous Osaka treat.",
