"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/ESsZZkAgZlPT_AzlArFLbw/l.jpg",
"rating":"4.0",
"reviewcomment":"I like the group of Alcyon.  When I was an office worker, my superior gave all the female workers a mini whole decoration cake with colorful fruits of Alcyon in White day.  Since then I has been a fan of Alcyon.  I went to the main café for several times.   A friend of mine took me to this associated crape café on her treatment.<br>To tell the truth, I introduced her to an eligible man for marriage.  As for result, I don&#39;t say here, but she treated me to show her gratitude.  Thanks to her, I had a very good lunch here.  <br>Although we had a map, we lost the way.  Similar streets are lined side by side, so we were confused.  We arrived at the café safely and went up steep stairs.  The café was very narrow.  In addition tables and chairs are jam-packed.  Like an old café in Europe.  We felt as if we were Parisian women.  <br>By the way at lunch time we ordered galettes, which are made of buckwheat flour and are not sweet but served as main dish.  I like galette very much.  It was very tasty and nutritious because it contains vegetables.  I wish my mother would eat it.  But she has an allergy for buckwheat flour.  She loved buckwheat noodles and ate them too much, which results in her development in an allergy for buckwheat flour.  <br>Everything was lovely and fashionable in the café.  We had a happy time in chatting and eating.  Next time I&#39;ll come here to eat crape, which is one of my favorite sweets.",
