"rating":"4.5",
"reviewcomment":"I wanted to buy some breads for tomorrow breakfast and dropped in at the café and bakery.  If I would like to have tea, I have to take off my shoes and wear a pair of slippers.  I wanted to use a restroom.  Though I only would buy breads, I could not help but take off my shoes.  <br>There are many kinds of breads in a showcase.  I was glad to see all of the breads placed in the showcase with sliding doors for dusts or insects not to enter it.  All of them are at 150yen or so.  Very cheap!  In the bakery shops in urban area it costs more than 200yen.  I chose three.  One for pizza bread, another is bread containing cooked burdock and lotus root, the other is Danish.  I shared them with my husband the next day morning.  It was very very good!  If I live in Nakazakicho, I will buy some everyday.  <br>If you have coffee or tea here, you spare time at counter table (only counter seats here).",
