"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/v46D_38hjgFewm5_i3SWbQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Actually we just went into this place randomly as we had come to Namba trying to go to Maru-joe and it was closed.  This place smelled really good to me from the outside and so we stepped in.<br><br>I actually wasn&#39;t super hungry (I had already eaten 3 meals) and was just tagging along for the ride because my husband wanted ramen, but the smell was so incredible I ended up ordering some tsukemen.  They give you a choice of tsukemen broth, and I think there were 3 but I went with yuzu-shio.  Husband got tonkotsu ramen + chashuu extra and their black fried rice I think it was called. <br><br>There&#39;s kind of a funny sign there of rules for the store which were interesting.  The ordering system is meal ticket machine so it&#39;s pretty simple.<br><br>The food came, and it was all really really good.  The only thing I think he didn&#39;t really like was the regular ramen was of the thinner noodle variety so he ordered them on the harder side and they were a little too hard for him.  I on the other hand thought the fat delicious noodles for the tsukemen were perfect.  I would have kept eating too if I wasn&#39;t totally overdoing it that day. I had about half of mine (but all the chashuu because it was perfectly meltingly fatty and delicious).  The yuzu-shio (citron/salt) broth was perfect, and it even had some yuzu rind in it for extra flavor.  They recommended &#34;black 7 spice powder&#34; which I tried and that was great too.  The fried rice was also great.  <br><br>Would love to try this place on an empty stomach again one day.",
