"rating":"4.5",
"reviewcomment":"Whenever I went to National International Museum, I passed in front of this sweet café.  Since then I had been interested in and wanted to enter it.  There are also nice cafes around the museum.  So I had little opportunity to drop in at the café.  But at last I had a chance to come in.  <br>After graduating from the Kimono-wearing school, I put on kimono and enjoyed going to museums.  So after seeing the exhibition of National International Museum, I entered the long-wished café.  A tiny café which mainly provides some soups.  I&#39;ve finished lunch at another restaurant, I had a tea and sweet.  I like a pan cake but on that day I ordered a seasonal cake.  It was very tastier.  Interior was also special!!  Warm, tasteful and relaxing.  As I was in kimono-style, the very charming female owner? or staff member? began to talk me and thankfully praised me on wearing kimono neatly.  I was very glad and asked her various things about shop.  On the basement it is a rental gallery.  Some events are held occasionally.  I became interested in the space and wanted to look around the basement.   She made me a proposal, &#34;Please look at the basement.  May I show you around?&#34;  However the stairs were a little steep and narrow.  In addition on the walls valuable ceramic wares were displayed.   Therefore I declined her favorable proposal.  <br>Next time I will try soup lunch.  I&#39;m looking forward to having it.",
