"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/ETm7LmeC6fHvmu4N72OP7A/l.jpg",
"rating":"4.5",
"reviewcomment":"Attracted by its tasteful outward appearance, I entered this café restaurant.  Contrary to outer ferroconcrete and stylish building, inside has wooden and warm atmosphere.  <br>A female clerk asked me whether I smoked or not.  I answered I didn&#39;t smoke.  So she took me to the non-smoking terrace table.  I enjoyed the outside scenery from the large glass window.  On the wall a movie was shown.  I sometimes watched it.<br> There are a lot of lunch menu such as omelette rice cereals with mushroom demiglas sauce, pasta lunch, stewed meat patty with onsen egg(egg steamed or boiled in the hot spring water), plate lunch and so on.  <br>I ordered a plate lunch which contains mainly vegetables with 47 ingredients.  This week&#39;s main dish is baked chicken and fried white fish.  This plate lunch has drink menu in which I can choose favorite one.  I chose vegetable juice.  It is rare.  Usually drink set menu has coffee, tea, herb tea, orange juice, apple juice, cola and so on.  So the vegetable juice I ordered is mixture of soy bean milk, green and yellow vegetables, and grape.  It tasted fresh and good!  Cakes also looked so delicious that I ordered a pumpkin cake.  I like pumpkin very much.  Some are smooth other are not strained, which tasted very good!! I became a fan of this cake.  The lunch plate cost 800yen, reasonable price.  The restaurant is spacious so you can hold a meeting or party here in fashionable Horie area.",
