"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/9heBAdcLBYw3BsPojEGhQA/l.jpg",
"rating":"4.0",
"reviewcomment":"I had lunch with a friend of mine.  When I was walking from Honmachi to Yodoyabashi, I happened to find the restaurant.  I like Vietnamese cuisine.  Unlike Tai foods its taste is mild and a little sweet and not so hot or spicy.  I am not good at hot or spicy foods, because I sweat a lot, when I eat them.  To get the worse, they cause me a bitter headache.  <br>The restaurant is located in retro Shibakawa building.  I felt as if I were in Vietnam(I would like to travel to Vietnam someday).  As for furniture, interior, or table wares, everything has a good atmosphere.  <br>We ordered a mini course for lunch.  Especially I looked forward to eating pho and raw spring rolls (called &#34;Namaharumaki&#34;).  All of the dishes met my expectation.  Mild taste and artistically arranged.  Last we ordered Vietnam milk coffee(it uses condensed milk instead of milk).  It was strong taste.  A little heavy for my stomach.  A cake was also good.  But I&#39;m sorry that I forgot what cake I was served.  <br>Staff&#39;s attitude toward customers were also nice.  When my friend was eating something, she suddenly began to be choked.  The staff rushed to us to give her water.  <br>In lunch it is not so expensive.  You can eat lunch at 2000 yen or so.  <br>You can never fail to come to this restaurant, if you love Vietnamese food.",
