"rating":"4.0",
"reviewcomment":"If my acquaintance of Tokyo comes to Osaka, I want to take her to this udon shop.  It offers not only the udon but also Donburi or Sushi, but I recommends udon if you come here.<br>It is available whether Udon is cold or hot.  I had eaten only warm one, but at first was surprised at the size of the bowl.  There is the double of the bowl of common udon.  It is totally like a bowl which &#34;Hachikaburi Hime&#34; or the princess wearing a bowl put on.<br>The udon is chewy and fluent and comes into a throat slipperily.  The soup stock has a feeling that the taste of the bonito worked, but it is full of flavors and is smart plainly.<br>There are curry and the cream-based udon, too. I like the curry udon but I do not have the courage to challenge the cream udon because the cream is suitable for pasta.<br>This Japanese-style restaurant has a tasteful atmosphere, which makes me relaxed.<br>The price is slightly high in comparison with other restaurants, but there is no help for it when it is this quality.<br>The person who has not eaten here should come once.",
