"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/DgOBJ24cDOEasEp1Mz5kGw/l.jpg",
"rating":"4.0",
"reviewcomment":"When I entered this restaurant, it was over 1 pm.  I was taken to  a counter seat.  Nevertheless for out of lunch time hour, a customer came in the restaurant one after another.  All seats were occupied.  <br>The restaurant has small space only with 3 counter seats and 10 table seats.  A cook and one stuff serve the customers.  Although I think they are of course busy, they serve them gracefully.  Time flows at a slow pace here.  <br>The cook cooked in front of me.  I was very very hungry.  The smell of dishes made my mouth water.  It took a little time to for dishes to arrive at me.  Because only two persons managed to do business, I thought that there was no help for it.<br>The lunch I ate was very very delicious.  This day&#39;s menu was an hors d&#39;oeuvre full of vegetables such as turnip mousse, handmade pickles, creamy mushroom flan, smooth soup made from sweet potato and pumpkin, chicken sauté with chestnut and mushroom sauce as a main dish and rice.  I was satisfied with a lot of ingredients in the dishes.  <br>I love chocolate, so I ordered a dessert which was chocolate terrine with ice cream and hot tea or coffee.  The ice cream melted with the hot chocolate terrine.  It tasted special!!  In addition it cost only 400 yen after  meal.  Lunch costs 900 yen.  It only deals in table d&#39;hote in lunch.  <br>The staff took me to the door and made a bow when I left the restaurant.  Very polite and gentled restaurant.  I felt the restaurant also melting in Nakazakicho.",
