"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/DOisNsYPDZrkRMPyBK5Hzg/l.jpg",
"rating":"4.5",
"reviewcomment":"Fresh off the plane from the United States, this was the first meal I had during my recent trip to Japan.<br><br>With admittedly limited exposure to the Osaka restaurant scene, I got the feeling this is a &#34;neighborhood joint&#34; kind of place, no fuss, nothing too fancy, but not divey either.<br><br>Seating is private room oriented and you take your shoes off and sit in an area secluded to just your party. Then, they bring you course after course of delicious food.<br><br>What we had:<br>-Sashimi (basic variety, very fresh!)<br>-Fried steak (kind of like karaage, maybe better)<br>-Potato croquettes (what&#39;s not to love about those)<br>-Mixed rice with nata, fermented soy beans (feels very Japanese)<br>-Tamago (egg, about average)<br><br>At about $25USD a person (tax, tip, beverages included) the meal was a steal of a deal!",
