"rating":"4.5",
"reviewcomment":"I was taken here by a female friend of mine, who has much information on nice restaurants or cafes.  Under the elevated rail tracks, there are restaurants, cafes or shops　side by side.  But this restaurant is located a little away from them.  So you may not find it easily.  But she discovered the restaurant by internet and knew it was delicious.  We had lunch here.  It has also open-air space.  On shiny or warm day I advise you to have lunch in open-air space.  You can also take your dog only in open-air space.  We visited the restaurant in summer, so we chose indoor.  <br>As for taste or table wares it was nice but dishes were a little heavy for me.  I like mild taste.  If I were young, I would like its taste.  <br>Dinner time is different from lunch time in atmosphere.  I&#39;ve never come here at night.  I would like to come here for a female friends&#39; meeting called &#34;Jyoshi-kai&#34; someday.",
