"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/jNhOgiIthLYqe-lni4W25w/l.jpg",
"rating":"4.0",
"reviewcomment":"When I came here in the afternoon, it was crowded with customers.  So as I had to wait for a little, I gave it up.   Why was it crowded, as it is away from the bustle of big cities like Umeda, Shinsaibashi, Nanba and Tennouji?  I thought about it and made out the reason.  It is near the rose garden.  During the time when roses are blooming, people rushed the garden to watch beautiful colorful roses.  <br>Though I gave up having tea in the afternoon, I had dinner with friends of mine on the next opportunity.  Of course I made a reservation on this time.  <br>They serve old-time Western dishes.  This restaurant is famous for omelet with a filling of ketchup-seasoned fried rice.  Its charm is in reasonable price.  An omelet Rice here is neatly oval-shaped by being wrapped in a thin sheet of egg omelet.  I prefer a mushy out of shaped omelet rice to an oval-shaped type. <br>So I chose a la carte menu, not a course menu).   I ordered a set of beef stew.  The meat is soft and demiglace sauce is special.   I enjoyed dinner within 2000yen.  Generally it costs 3000 yen or so on average at dinner in other restaurants.   <br>We spent a good time having dinner in the nostalgic restaurant (it was built in the Taisho era).  <br>The only disadvantage is that there is no restroom in the restaurant.  Of course the building has ones.  But they are a little away from the restaurant.  Additionally there are sparse people around the restroom.  A woman may be afraid to get there alone.",
