"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/P4j7VkrNKqAqjgwOmFjiww/l.jpg",
"rating":"4.5",
"reviewcomment":"I came here with friends of mine after movie at night.  We walked along certainly stone-paved alley where it has time-honored atmosphere.  Under moon light and electric light gently reflecting the pavement, we were heading for the noodle shop.  <br>Soba is buckwheat noodles.  The most famous in this shop is called &#34;Yugiri Soba&#34; which was named after a character of &#34;Kuruwa Bunsho&#34; written by a famous Joruri writer &#34;Chikamatsu Monzaemon&#34;.  This Yugiri Soba is mixed with grated peels of domestic citrons whose flavor is good.    Anyway, it tastes very delicious.  <br>Cold or hot Yugiri soba costs 1100 yen.   If you would like to add &#34;Tenpura&#34; (Prawns, small fish, squid, or vegetables are deep-fried after dipped in batter , which is a mixture of wheat flour, egg, and water), it costs 2000 yen.  Other soba for curry noodles or soba with cooked duck costs 950 yen.  <br>I like the time-honored atmosphere in this shop.  I feel as if I were a leading character of a novel when I come here.  <br>Someday I would like to write a novel in which this restaurant is  model.",
