"reviewcomment":"I came here three times for lunch and café.  When I had lunch with my husband before a movie preview, I found an invitation leaflet to an opening party, as the new branch will open at Nanba.  But it was lottery.  At once I applied for it writing impressions about this shop and so on.   Later, I got an invitation ticket and went to the opening party with my friend.   The new branch is located in front of the river and was crowded with a lot of guests congratulating on the new open.  We enjoyed buffet style dinner and sometimes took a rest on the river side.<br>Anyway, this restaurant has a good hospitability, dishes and reasonable fare.   I got a five hundred yen discount ticket of such and such gourmet website.  I showed various  restaurants to use it, but all the restaurants except here refused the use of the ticket.  I could use it only in this restaurant.  So I could eat a cake and cup of tea at the price minus five hundred yen.  <br>Also under such a reason I like this café very much.",
