"reviewcomment":"I believe this place is the best pizzeria in Osaka!<br>Naples-style pizzas are baked in red-tiled hearth brought from Italy.<br>Very small place... seats only 8 or 9... booking in advance is a must.<br>Shigeo, the owner/chef really makes your tastebud wide open with the antipasto-misto (500JPY per person!). Pizzas are lovely!! I love the dough; not the crispy type, but has the chewy texture, with a hint of saltiness. The smoky flavor drives you crazy. When you first come here you may want to try from Margherita. I love all of his pizzas, but especially &#34;smoked mozzarella + squid ink&#34; pizza is a masterpiece --- you&#39;ve never had something like this, I guess ---- .<br>Other than pizzas, there are other dishes --- few pastas, grilled meat/seafood/veggie, salads, et al. Grilled dishes are my favorites too. Look for today&#39;s special on the blackboard. Limited wine list, but homemade sangria is wonderful. <br>Shigeo runs this pizzeria all by himself. You can book your seats starting from 6pm or 8:30 pm, but you&#39;ll be asked to leave your seats in about 1.5 hrs to 2 hrs. Not suitable for kids, but you can ask for takeouts by prior arrangements.",
