"rating":"4.5",
"reviewcomment":"It is like a residential restaurant.  I feel as if I visited someone&#39;s luxurious home with wooden terrace, greenery garden......If this is a real house, I cannot help being jealousy toward its owner.  <br>Attracted by its outside warm appearance, I opened a large wooden door and entered this café restaurant with much expectation.   Its inside has also natural taste, so I feel very relaxed and cozy.  In winter the restaurant lends a blanket to the customers lest they should feel cold.  I was moved by its polite and elaborate manner.  It provides natural and nutritious menu with many fresh vegetables.  It boasts of domestic and organic farm products so I can eat them safely.  The beautifully and colorful arranged dishes are put on pottery wares. I prefer pottery to porcelain, because it has warm atmosphere.  It costs around 1000 yen during lunch time.  <br>Tables and seats are housed with intervals and I am not worried about the conversation of other customers.  I came here for several times alone, but I will take a friend of mine here someday.",
