"reviewcomment":"Fantastic restaurant!<br><br>Fujiya 1935 is a very affordable Michelin star restaurant.  Unfortunately, as most tourists bypass Osaka, many will overlook this place.<br><br>The restaurant is located in an unassuming building but fairly easy to find with Google Maps.  The decor is fairly modern with dim lighting.  There are two floors and it is quite spacious inside.<br><br>Food-wise, it&#39;s fantastic.  The menu changes every few seasons.  The food not only tastes great but you can really tell that there&#39;s almost a component of molecular gastronomy.  One interesting part of the meal was the presentation of chestnuts in a box with pot pourri with the smells of Autumn (it was November when we ate there).<br><br>Service was attentive and prices were more than reasonable at around $175 a person including wine.",
