"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/Hu93dY21XCjNfuIQijiaDg/l.jpg",
"rating":"3.0",
"reviewcomment":"I&#39;ve been coming to Critters Burger ever since I moved to the area three years ago, and I have to say: This is one of the best burger places (if not THE best burger place) I&#39;ve found in Japan.<br><br>As the review in Japanese points out, it is indeed expensive. However... It&#39;s Osaka, and Ame-Mura... What did you expect? The price is in line with other food options of this caliber in the area. For the high price, you get a big burger (by Japan&#39;s standards) and some fries; not bad!<br><br>The burger menu is expansive, ranging from classic ham and cheeseburgers on up to the usual range of &#34;gourmet&#34; burgers (blue cheese and  mushroom, BBQ, etc.) and even some really unique options. They even have a monthly special! Drinks are similarly expensive, but also similarly plentiful. The restaurant has an *ok* selection of beers, and a few gems (like rootbeer floats!).<br><br>I can&#39;t speak much to the menu beyond drinks and burgers... But I will say that the few times I&#39;ve ventured into the appetizers I&#39;ve been disappointed. Probably best to stick to the burgers.",
