"rating":"4.5",
"reviewcomment":"Pretty nice craft beer spot in the Umeda/Osaka station area.  It&#39;s got a spectacular view (31st or 32nd floor?) of the area and had about 16 taps or so IIRC of all Japanese craft beers.  They also have an Italian inspired food menu but we didn&#39;t eat anything.<br><br>Basically, all in all, though the service was understaffed/a little forgetful of us compared to many places and there was no bar seating (weird) it&#39;s my perfect vacation pub: nice view, decent place, LOCAL beers.  This place was a little on the pricier side but they gave us a container of pistachios to munch on and like I said, if you consider how great the view is, not so bad.<br><br>OH!  And I kind of wish I had visited this place near the beginning of my trip instead near the end, because outside they have a bunch of free flyers and one of those was an annual map that showed all of the craft beer related bars and bottle shops in Osaka.  That information would have been really helpful earlier on.",
