"categorystrlist":"Italian,         French",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/ocQS5dLtq1n7AwUTqCEBKg/l.jpg",
"rating":"4.5",
"reviewcomment":"I went to Italian buffet today. Buffet is a help-yourself-to ann-you-can-eat meal.  In Japan it is usually called &#34;Viking&#34;.  In front of the restaurant a good-looking guy was standing.  He is staff of the restaurant.  A lot of female customers may be attracted to the restaurant by his good appearance.  The staff of the restaurant escorted me to the second floor. The first floor is for customers who don&#39;t wish for buffet and have ordinary lunch. <br>I&#39;ve ever been to buffet of various foods which are mixed with Japanese, Chinese, Italian, India cuisines and so on. However it is the first time that I went to only Italian buffet. 　About five kinds of pizza, pasta, fried chickens, cooked vegetables and meats are lined up. I was very very hungry so that I went straightly to one long table where a number of wonderful foods are heaped in dishes. I put various foods on a plate. But the plate is a little small so that not many foods were put on it. So I used two plates. One for pizza and delis, the other for salad. All of them are very good! I have to finish within 90 minuites. Hurry up!! I ate, ate and ate something silently. <br>I finished eating and went to a restroom. In the restroom there are some considerations for women. After I returned, I discovered some desserts and a fruit. Before I left the seat, I didn&#39;t find any dessert. So I took all of them. Coffee jerry, fruits punch, baked cake, and orange. I was happy to find them. They satisfied my another belly. <br>Service is also excellent. The staffs left my empty plates quickly. As soon as I dirtied my fork by mistake, he exchanged it for new one with smile.<br>In addition it cost only one thousand yen including tax. If you drink freely, you have to pay another two hundred yen.  I&#39;m stingy and I drank only water. <br>The buffets I have ever been to cost 2000yen on average. Today&#39;s restaurant is absolutely cheap!! The cheapest one that I had ever been to cost 1350yen or so, but it included some drinks. <br>I would like to come here again. It was very pleasant lunch.<br><br>Attention:  There is a step between counter corner and food corner.  Be careful not to tumble.",
