"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/gXKQVtVC7HYiyX7RCVnxiQ/l.jpg",
"rating":"4.0",
"reviewcomment":"The reason why I had lunch in this café is that I read reviews in a famous website introducing only restaurants.  Customers who ate some foods in this café praised female owner too much.  &#34;She is a smart cool woman.&#34;  &#34;She is beautiful.&#34;  &#34;She has good feeling.&#34;  And so on.   I became interested in her, so I decided to have lunch here.  As the number of the lunch is limited, I called her at first.  Her voice is low and calm.  So I was more and more interested in her.  Then I arrived the café which stands near the girder bridge.  The inside was simple and clean.  The female owner has short-cut hair style and is a smart woman.  <br>I ordered lunch set.  The weekly menu is pork piccata, soup, salad, mixed grain rice and coffee or tea.  I was advised to have coffee by a female owner of a boutique nearby, who was an acquaintance of this café.  So I chose coffee.  I added to a cake in a half size, which costs only 200 yen.  <br>All of them tasted very nice.  The piccata was light and crispy, which didn&#39;t be a burden for my stomach.  <br>Customers, probably inhabitants around here (elderly couples or elderly women) came in one after another.  Maybe they are fan of the female owner.  She has an atmosphere attracting people.  She managed the café alone.  If she was not so busy, I would talk to her.  On next time I tried to talk her a lot.",
