"rating":"4.0",
"reviewcomment":"I came here with a friend of mine before a movie preview held in L theater near the restaurant.  The advantage of this Pasta restaurant is that it opens from 11:00am through 20:45pm.  Most restaurants have lunch time and dinner time separately.  However this restaurant is on business from the opening to the closing times.  Usually a movie preview starts on 18:30 pm and the theater opens the door at 18:00 pm.  Dinner time usually begins on 17:30 in most restaurants.  In such a case we can&#39;t be in time for the movie.  <br>I ate tomato source based pasta.  The raw pasta with chewiness is made in this restaurant.  There are many kinds of source based on tomato, cream, Japanese-flavored tastes.  Prices are quite reasonable.  I paid only 1300 yen or so with pumpkin soup.  There are a variety of wines lined up.  The restaurant&#39;s casual atmosphere hosted a lot of youth as well as adult.  <br>When I left the restaurant, I was given a 50 yen discount ticket.  I&#39;ll use it on another occasion.",
