"reviewcomment":"It was my first visit after I took a medical check-up called &#34;Ningendock&#34; at a clinic in the vicinity.  I got a food ticket of restaurants available around Hotarumachi.  I chose this café among a lot of attractive restaurants.  The reason is that they provide health-conscious dishes and sweets mainly based on ingredients of soybeans such as black soybean rice, bean curds hamburger, soybean milk pudding, etc.  I ordered a hamburger set (not bread) made from bean curds, which was gentle taste compared with meat hamburger.   I like it too.  I ordered soybean milk pudding as a dessert, which tastes smooth and enriched flavor.  <br>I like old atmosphere of earth walls, old pot and furniture in this cafe.   It goes without saying that I took friends of mine on another occasion because I went for the café.",
